import React, { Component } from 'react';
import Header from '../../components/Header/Header';
import Footer from '../../components/Footer/Footer';
import SideBar from '../../components/SideBar/SideBar';
import axios from 'axios';
class Product extends Component {
    constructor(props) {
        super(props)
        this.state = {
          products: []
        };
    }

    componentDidMount() {
    axios.get('http://localhost:8000/api/admin_product/')
        .then(res => {
        this.setState({
            products: res.data
        });
        })
        .catch((error) => {
        console.log(error);
        })
    }


    render() {
        return (
            <div className="container-scroller">
                <Header/>
                <div className="container-fluid page-body-wrapper">
                    <SideBar/>
                    <div className="main-panel">
                        <div className="content-wrapper">
                            <div className="page-header">
                                <h3 className="page-title">
                                    <span className="page-title-icon bg-gradient-primary text-white mr-2">
                                    <i className="mdi mdi-basket menu-icon" />
                                    </span> Product
                                </h3>
                                <nav aria-label="breadcrumb">
                                    <ul className="breadcrumb">
                                        <li className="breadcrumb-item active" aria-current="page">
                                            <span />Overview <i className="mdi mdi-alert-circle-outline icon-sm text-primary align-middle" />
                                        </li>
                                    </ul>
                                </nav>
                            </div>
                            <div className="card">
                                <div className="card-body">
                                <p class="title large">Transform chart</p>
                                    <table className="table table-striped">
                                    <thead>
                                        <tr>
                                        <th> ID </th>
                                        <th> Name </th>
                                        <th> Discount </th>
                                        <th> Price </th>
                                        <th> Category </th>
                                        <th> Vendor </th>
                                        <th> Action </th>
                                        </tr>
                                    </thead>
                                        <tbody>
                                            {
                                                this.state.products.map((item,index)=>(
                                                    <tr key={index}>
                                                        <td>{index}</td>
                                                        <td>{item.name}</td>
                                                        <td>{item.discount} $</td>
                                                        <td>{item.price} $</td>
                                                        <td>{item.service_category_id} $</td>
                                                        <td>{item.vendor_id} $</td>
                                                        <td><spand>
                                                                <button type="button" class="btn btn-gradient-primary btn-rounded btn-icon"><i class="mdi mdi-delete"></i></button>
                                                                <button type="button" class="btn btn-gradient-primary btn-rounded btn-icon"><i class="mdi mdi-pot-mix"></i></button>
                                                            </spand>
                                                        </td>
                                                    </tr>
                                                ))
                                            }
                                        </tbody>
                                    </table>
                                </div>
                            </div>
                        </div>
                        <Footer/>
                    </div>
                </div>
            </div> 
        );
    }
}

export default Product;
